import React from 'react';

function BrokerHome() {

    var styles={
        brhome:{
            background : "rgb(2,0,36)",
            background :" linear-gradient(90def, rgba(2,0,36) 0%, rgba(9,9,121,0.6867880941) 38%,rgba(2,212,255,1) 100%)"
        }
    };

  return (
    <div style={styles.brhome} className="brhome">
        BrokerHome
    </div>
  )
}

export default BrokerHome
